import React from 'react';
import './Menu.scss';


interface Song {
    artist: string;
    songName: string;
    duration: number
}

const Menu: React.FC<Song> = () => {
    return(
        //p
        
        <div className="container">
            <ul className="container list">
                <li>Katy Perry</li>
                <li>50 Cent</li>
                <li>Eminem</li>
            </ul>
        </div>
    )
}

export default Menu;
